:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Francis James Volkner (Frank) and STANDISH, Edith Frances
  JWILLIAMS, Gerald Standish and ROLLESTON, Rachel Fane
  05> WILLIAMS, Gerald Standish m on 22.06.1946 to ROLLESTON, Rachel Fane
  b 10.08.1915
  b 10.05.1919
  Gerald b. at Waipare, Anaura Bay, East Coast and m. at Timaru. Rachel, d/o Francis
  Joseph Rolleston (solicitor of Timaru) and Mary Winifred Blair, b. at Timaru.
  Address: 41 Rokino Road, Taupo.
  Gerald was educated at Hereworth School and Christ's College. After a few years
  spent gaining farming experience he joined the RAF in 1939 and trained as a pilot.
  In 1941 his aircraft failed to return from a raid on Turin. He and the other crew
  of his four-engined Halifax were captured and became POW's. In 1942 he and a South African friend escaped
  from Oflag VIB, north-west of Kassel, and 17 days later, having walked 275 miles through Central and
  Southern Germany under cover of darkness, they were both recaptured in the Black Forest, 70 miles from the
  Swiss frontier.
  He returned to New Zealand after the war and in 1951 was able, with the assistance of a Rehabilitation
  Loan, to purchase a 330 acre property near Takapau, Hawkes Bay, where he and Rachel farmed until it was
  sold in 1973. They then moved to Taupo and were, for some years, involved in managing tourist lodges in
  Fiordland and other areas, Gerald's interests include wildlife and trekking in mountainous areas.
  Rachel was educated at Craighead and Woodford House. During the war she did secretarial work for her
  father in Timaru and after her marriage she farmed with Gerald. She has played golf and tennis
  competitively. Since moving to Taupo she has been involved in community work including the Red Cross, the
  Salvation Army and the Hospice Movement.
  01> WILLIAMS, William Rolleston m on 27.01.1973 to DAVEY, Jillian Myrtle
  Standish (Bill)
  b 20.07.1947
  b 02.11.1946
  Bill b. at Hastings and m. at Takapau. Jill, d/o Jack Ferguson Davey and
  Myrtle Farquhar Smith. Address: 61 Balmain Road, Birkenhead, Auckland 10.
  Email: wrs. williams@auckland.ac.nz.
  Bill was educated at Hereworth School, Christ's College, Victoria University
  | of Wellington (LLB, 1970) and Canterbury University (Dip in Journalism, 1972).
  He has worked as a law clerk, as a sub-editor for the New Zealand Press
  Association, as a reporter for newspapers in Auckland (Auckland Star), Johannesburg (Johannesburg Star)
  and Cardiff (South Wales Echo), and as an editor and administrator for the Auckland District Law
  Society. Currently he is Public Relations Officer at the University of Auckland.
  Jill graduated from Ardmore Teachers' College in 1965, and from Massey University with a BA in 1967 and
  DipSLT in 1989. She teaches English as a Second Language at Westlake Girls' High School, Takapuna,
  Auckland.
  01> WILLIAMS, Frances Rachel
  b 18.01.1976
  Frances b. at Newport, Wales. Address: Christchurch.
  Frances was educated at Westlake Girls' High School. She graduated BSc from the
  University of Otago in 1997 and is currently studying towards an MSc in Industrial
  Psychology at the University of Canterbury.
  02> WILLIAMS, Clare Jane
  b 20.12.1977
  Clare b. at Auckland. She was educated at Westlake Girls' High School and commenced
  a Bachelor of International Communications course at Unitec Institute of Technology
  in 1998.
